SET @CGUID :=361993;
SET @OGUID :=226662;
SET @Event = 12;

DELETE FROM `gameobject` WHERE `guid` BETWEEN @OGUID+0 AND @OGUID+5347;

DELETE FROM `creature` WHERE `guid` BETWEEN @CGUID+0 AND @CGUID+104;

-- Link Creatures to event
DELETE FROM `game_event_creature` WHERE `eventEntry`=@Event AND `guid` BETWEEN @CGUID AND @CGUID+104;

-- Link Objects to event
DELETE FROM `game_event_gameobject` WHERE `eventEntry`=@Event AND `guid` BETWEEN @OGUID AND @OGUID+5347;
